INSERT INTO `news` VALUES (1,'Tecnologias para pecuária de baixa emissão de carbono serão apresentadas no Ceará','<p>Novas tecnologias e alternativas para a redução de emissão de \r\ncarbono serão apresentadas no 1º Fórum sobre Pecuária de Baixa Emissão \r\nde Carbono, no próximo dia 7, no PECNordeste 2017 (Seminário Nordestino \r\nde Pecuária), em Fortaleza. O fórum realizado pelo Ministério da \r\nAgricultura, Pecuária e Abastecimento (Mapa), com apoio do Instituto \r\nInteramericano de Cooperação para a Agricultura (IICA) e da Embrapa \r\nacontecerá, depois, nas demais regiões. “Vamos tratar do aproveitamento \r\nde resíduos e o consequente aumento de renda dos pecuaristas, \r\nestimulando o uso adequado do biofertilizante gerado pela própria \r\natividade”, adianta o consultor do Mapa e médico veterinário, Cleandro \r\nPazinato Dias.</p>\r\n<p>O objetivo é sensibilizar a cadeia produtiva de bovinos de corte e \r\nleite para o uso de tecnologias que, além de reduzir emissões propiciem a\r\n sustentabilidade, como a gestão racional da água e dos alimentos, a \r\nimplantação de biodigestores, compostagem e a geração de energia \r\nelétrica por meio do biogás produzido a partir de dejetos, inclusive em \r\nsistemas confinados. A avaliação sobre a viabilidade de cada projeto em \r\ntodas as regiões será concluída ainda no segundo semestre deste ano.</p>\r\n<p>O auditor fiscal federal agropecuário do Mapa e coordenador técnico \r\ndo projeto, Sidney Medeiros, destaca a importância do projeto na \r\ncontribuição da meta global do Plano Setorial de Mitigação e Adaptação \r\nàs Mudanças Climáticas na Agricultura, Plano ABC.</p>\r\n<p>Voltado para produtores, técnicos, acadêmicos e agentes \r\nfinanciadores, o evento no Ceará é resultado de levantamentos realizados\r\n por meio do Projeto “Pecuária de Baixa Emissão de Carbono: geração de \r\nvalor na produção intensiva de carne e leite”. Entre os palestrantes, \r\nalém de Sidney Medeiros, estão os consultores Cleandro Pazinato Dias, \r\nFabiano Coser e o pesquisador da Embrapa, Marcelo Henrique Otenio.</p><p><br></p><p>Fonte: <a target=\"_blank\" rel=\"nofollow\" href=\"http://www.agricultura.gov.br/noticias/ceara-sedia-o-1o-forum-de-pecuaria-de-baixa-emissao-de-carbono\">http://www.agricultura.gov.br/noticias/ceara-sedia-o-1o-forum-de-pecuaria-de-baixa-emissao-de-carbon...</a></p>','2017-06-06 14:24:53','2017-06-28 16:34:08','Uma das discussões em fórum, marcado para o dia 7 de julho, será em torno da produção de biogás a partir de dejetos');
/*!40000 ALTER TABLE `news` ENABLE KEYS */;
UNLOCK TABLES;

